import React, { useState, useEffect } from 'react';

function Navbar() {
  const [time, setTime] = useState(new Date());

  useEffect(() => {
    const timer = setInterval(() => setTime(new Date()), 1000);
    return () => clearInterval(timer);
  }, []);

  return (
    <div className="flex justify-between items-center px-6 py-3 bg-gray-800 bg-opacity-70">
      <div className="text-xl font-semibold">NeeOPiloT</div>
      <div className="text-lg">{time.toLocaleTimeString()}</div>
      <div className="flex items-center gap-3">
        <span className="text-green-400">100%</span>
        <span className="text-blue-400">5G</span>
      </div>
    </div>
  );
}

export default Navbar;
